import React, { useEffect, useState } from "react";
import { GoogleGenerativeAI } from "@google/generative-ai";

function AIDoctor() {
  const [history, setHistory] = useState([
    {
      role: "user",
      parts: [{ text: "Hello" }],
    },
    {
      role: "model",
      parts: [{ text: "Great to meet you. What would you like to know?" }],
    },
  ]);
  const [response, setResponse] = useState("");
  const [input, setInput] = useState(""); // To capture user input
  const [loading, setLoading] = useState(false); // To avoid double send

  // Function to handle sending a new message
  const handleSendMessage = async () => {
    if (!input.trim() || loading) return; // Prevent empty inputs and double submits

    setLoading(true); // Lock the button while processing

    try {
      const genAI = new GoogleGenerativeAI(
        "AIzaSyBhtwZ7D1H9w6iAg31HcO2CankgOh5dsHk"
      );
      const model = genAI.getGenerativeModel({ model: "gemini-1.5-flash" });

      // Add the user's message to the history
      const updatedHistory = [
        ...history,
        {
          role: "user",
          parts: [{ text: input }],
        },
      ];
      setHistory(updatedHistory); // Update local history

      const chat = model.startChat({ history: updatedHistory });

      const result = await chat.sendMessage(input); // Send user input as message
      const text = await result.response.text(); // Await the model's response

      // Add the AI model's response to the history
      setHistory((prevHistory) => [
        ...prevHistory,
        {
          role: "model",
          parts: [{ text }],
        },
      ]);

      setResponse(text); // Update the UI with the latest response
      setInput(""); // Clear the input field after sending the message
    } catch (error) {
      console.error("Error fetching AI response:", error);
    } finally {
      setLoading(false); // Unlock the button
    }
  };

  return (
    <div className="chat-view w-full h-screen mt-10 flex justify-center items-center">
      <div className="chat-body w-full h-full m-10 flex justify-center items-center rounded-3xl shadow-animate relative">
        <div className="chat w-full h-full flex flex-col bg-[#202024] text-white rounded-3xl m-10 z-10">
          <div className="w-full p-5 flex justify-center items-center rounded-3xl border-[#ffffff48] text-center bg-[#161616] border shadow-sm">
            <div className="text-xl font-semibold">AI Doctor</div>
            <div className="text-gray-500 mb-10">Chat with AI Doctor</div>
            <div className="selection-box flex justify-center space-x-4">
              <div>
                <input type="checkbox" className="" name="" id="" />{" "}
                <label>Need Doctor</label>
              </div>
              <div>
                <input type="checkbox" className="" name="" id="" />{" "}
                <label>Nearest Pharmacy</label>
              </div>
            </div>
          </div>
          <div className="w-full flex flex-col flex-grow m-10 rounded-3xl">
            <div className="chat-view flex w-full h-full rounded-t-3xl border-x border-t border-[#ffffff48] overflow-y-auto p-4">
              <div className="ai-chat flex flex-col space-y-4 w-full">
                {/* Map through the chat history and display each message */}
                {history.map((message, index) => (
                  <div
                    key={index}
                    className={`${
                      message.role === "user"
                        ? "user-chat self-end bg-gray-700"
                        : "ai-model-chat self-start bg-blue-500"
                    } p-4 max-w-[80%] rounded-lg shadow-lg`}
                  >
                    <div className="text-lg text-white font-semibold">
                      {message.parts[0].text}
                    </div>
                  </div>
                ))}
              </div>
            </div>
            <div className="chat-input flex w-full h-20 rounded-b-3xl border bg-[#303030] border-[#ffffff48]">
              <input
                type="text"
                className="w-full bg-transparent ml-4 border-none outline-none text-white"
                value={input}
                onChange={(e) => setInput(e.target.value)}
                placeholder="Type a message..."
                onKeyPress={(e) => e.key === "Enter" && handleSendMessage()}
              />
              <button
                onClick={handleSendMessage}
                className="bg-gray-600 hover:bg-blue-500 ml-3 w-20 rounded-br-3xl"
                disabled={loading}
              >
                {loading ? "Sending..." : "Send"}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AIDoctor;
